response.about:
- Со мной непросто найти общий язык, но если вам это удалось, на меня можно положиться;
- Я всегда сдерживаю свои обещания либо не обещаю вовсе;
- Стараюсь уважать чужое мнение, оставаться при своем и не навязывать его другим;
- Я люблю то, что не понимают многие и ненавижу то, что нравится большинству;
- Я против вредных привычек!;
- Я не такая, какой могу показаться изначально;
